import React from "react";

const LeftBar = ({ userName }) => {
  return (
    <div className="left-bar-container">
      <div className="left-bar-header">
        <img src={process.env.PUBLIC_URL + "/imgs/icon.png"} alt={"logo"} />
        <h4>{userName}</h4>
      </div>

      <div className="left-bar-menu-container">
        <div className="left-bar-menu-element">Accueil</div>
        <div className="left-bar-menu-element">Paroisses</div>
        <div className="left-bar-menu-element">Évènements</div>
      </div>

      <div className="left-bar-footer">
        <img
          src={process.env.PUBLIC_URL + "/imgs/icons/logout.png"}
          alt={"logo"}
        />

        <p>Se Déconnecter</p>
      </div>
    </div>
  );
};

export default LeftBar;
